import "./Tabs.css";
// import { PIERCING, MODEL, MODEL2 } from "../../images/images";
// import MODEL from "../../images/img/model.jpg";
// import PIERCING from "../../images/img/piercing.jpeg";

export const Tabs = ({ piers }) => {
  const list = [
    "Система 75 — самая современная и безболезненная система для прокалывания мочек ушей детям. Подходит даже с самого раннего возраста. ",
    "Большой ассортимент сережек-игл в стерильных картриджах, которые  приобретаются в наших студиях дополнительно.",
    "Поздравительная открытка  с инструкцией по уходу.",
    "Для ухода можно приобрести гель Studex для обработки ушек.",
  ];
  return (
    <div className="tabs__item">
      <div className="tabs__wrapper">
        <div className="tabs__content ">
          <img src={piers.img} className="tabs__img" />
          <div className="tabs__subbox">
            <div className="tabs__subtitle">{piers.title}</div>
            <div className="tabs__descr">{piers.descr}</div>
            <a href="" className="tabs__link"></a>
          </div>
        </div>
        <div className="tabs-change tabs-change_active ">
          <div className="tabs-change__title">{piers.title}</div>
          <ul className="tabs-change__list"></ul>
        </div>
      </div>
      <hr />
      <div className="tabs__footer">
        <div className="tabs__prices">{piers.price}</div>
      </div>
    </div>
  );
};
